import React from 'react';
// import './VideoDisplay.css'; // Import component-specific styles

const VideoDisplay = () => {
  return (
    <div className="video-display">
      <h2>Video Display</h2>
      <video controls>
        <source src="path-to-mock-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <div className="grid-overlay">
        {/* Render the grid overlay for region selection */}
      </div>
    </div>
  );
};

export default VideoDisplay;
